import React from 'react';
import {
  Carousel,
  Button
} from 'react-bootstrap';
import '../styles/MainBanner.css';


import yourImage from '../path-to-your-image.jpg'; // Update the path to your image

const CustomImageBanner = () => {
  return (
    <div className="image-banner-container">
      <img src={yourImage} alt="Descriptive Alt Text" className="banner-image" />
      <div className="buttons-container">
        <Button variant="primary">Sign Up</Button>
        <Button variant="secondary" className="ml-2">Take a Tour</Button>
      </div>
    </div>
  );
};

export default CustomImageBanner;
